export default (state={}, action) => {
	switch(action.type) {
		case 'SELECT_STRENGTH':
			return { goal: 'strength'}
		case 'SELECT_BODYBUILDING':
			return { goal: 'bodybuilding' }
		default:
			return state;
	};
};
